A live performance by Def Leppard &amp; Taylor Swift of When Love And Hate Collide from the show CMT Crossroads.



&quot;When Love &amp; Hate Collide&quot; is a song by British rock band Def Leppard from their 1995 greatest hits album Vault, written by Joe Elliot and Rick Savage. It was originally written and demoed for Adrenalize, but not finalized until 1995 for its inclusion on Vault. The demo version is much more heavily produced in the signature style of Hysteria and Adrenalize, and the final version is more stripped down, supposedly toward the style of the following studio album Slang. The original demo version contains the final recorded guitar solo by late original guitarist Steve Clark. &quot;When Love And Hate Collide&quot; became one of their most successful singles in their homeland, where it reached No. 2 in the UK charts, but it failed to make a significant impact in the U.S. charts.



